import React from 'react';
import '../pwetty_components/TitleAndCaption.css';

const TitleAndCaption = ({ title, caption }) => {
  return (
    <div className="title-caption-container">
      <h1>{title}</h1>
      <p>{caption}</p>
    </div>
  );
};

export default TitleAndCaption;
